import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Profile() {
    const navigate = useNavigate();
    const [userData, setUserData] = useState(null);

    useEffect(() => {
        const callProfilePage = async () => {
            try {
                const response = await fetch('/profile', {
                    method: "GET",
                    headers: {
                        Accept: "application/json",
                        "Content-Type": "application/json"  // Correct the content-type typo
                    },
                    credentials: "include"  // Ensure cookies are sent
                });

                // Check if the response was successful before parsing JSON
                if (response.status === 200) {
                    const data = await response.json();
                    setUserData(data);
                } else {
                    console.error('Failed to fetch profile, status:', response.status);
                    navigate('/login');  // Redirect to login if unauthorized
                }
            } catch (error) {
                console.error('Error fetching profile:', error);
                navigate('/login');  // Redirect to login on error
            }
        };
        callProfilePage();
    }, [navigate]);

    return (
        <section>
            <div className="container py-5">
                <div className="row">
                    <div className="col-lg-4">
                        <div className="card mb-4">
                            <div className="card-body text-center">
                                <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava3.webp" alt="avatar" className="rounded-circle img-fluid" />
                                <h5 className="my-3">
                                    {userData ? `${userData.firstName} ${userData.lastName}` : 'Loading...'}
                                </h5>
                                <p className="text-muted mb-1">Full Stack Developer</p>
                                <p className="text-muted mb-4">Bay Area, San Francisco, CA</p>
                                <div className="d-flex justify-content-center mb-2">
                                    <button type="button" className="btn btn-primary">Follow</button>
                                    <button type="button" className="btn btn-outline-primary ms-1">Message</button>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="col-lg-8">
                        <div className="card mb-4">
                            <div className="card-body">
                                <ProfileDetails title="Full Name" value={userData && `${userData.firstName} ${userData.lastName}`} />
                                <ProfileDetails title="Email" value={userData && userData.email} />
                                <ProfileDetails title="Phone" value={userData && userData.phone} />
                                <ProfileDetails title="Address" value="Bay Area, San Francisco, CA" />
                            </div>
                        </div>
                        <ProjectStatus />
                    </div>
                </div>
            </div>
        </section>
    );
}

// Helper component to render profile details
const ProfileDetails = ({ title, value }) => (
    <>
        <div className="row">
            <div className="col-sm-3">
                <p className="mb-0">{title}</p>
            </div>
            <div className="col-sm-9">
                <p className="text-muted mb-0">{value || 'Loading...'}</p>
            </div>
        </div>
        <hr />
    </>
);

// Helper component for project status
const ProjectStatus = () => (
    <div className="row">
        <div className="col-md-6">
            <div className="card mb-4 mb-md-0">
                <div className="card-body">
                    <p className="mb-4">
                        <span className="text-primary font-italic me-1">assignment</span> Project Status
                    </p>
                    {renderProgress("Web Design", 80)}
                    {renderProgress("Website Markup", 72)}
                    {renderProgress("One Page", 89)}
                    {renderProgress("Mobile Template", 55)}
                    {renderProgress("Backend API", 66)}
                </div>
            </div>
        </div>
    </div>
);

// Helper function to render progress bars
const renderProgress = (label, value) => (
    <>
        <p className="mt-4 mb-1">{label}</p>
        <div className="progress rounded">
            <div className="progress-bar" role="progressbar" style={{ width: `${value}%` }} aria-valuenow={value} aria-valuemin="0" aria-valuemax="100"></div>
        </div>
    </>
);

export default Profile;
